def get_estimate(items, start, capacity):
    total_value = 0.0
    while start < len(items):
        value, weight = items[start]
        start += 1
        if weight < capacity:
            total_value += value
            capacity -= weight
        else:
            total_value += value * float(capacity) / weight
            break
    return total_value


def solveItBnB(inputData):
    from time import time

    start = time()

    lines = inputData.split('\n')
    count, capacity = map(int, lines[0].split())

    items = [map(int, line.split()) for line in lines[1:] if line]
    count = len(items)
    items = [(index, item[0], item[1]) for index, item in enumerate(items)]
    items.sort(key=lambda item: float(item[1]) / item[2], reverse=True)
    sorting = [item[0] for item in items]
    items = [(item[1], item[2]) for item in items]

    best_value = 0
    current = [0] * count
    best = [0] * count
    stack = [(0, 0, capacity, 0)]

    while stack:
        use, index, weight_left, total_value = stack.pop()
        if index > 0:
            current[index - 1] = use

        if index < count:
            value, weight = items[index]

            estimate0 = get_estimate(items, index + 1, weight_left)
            if total_value + estimate0 >= best_value:
                stack.append((0, index + 1, weight_left, total_value))

            if weight <= weight_left:
                estimate1 = get_estimate(items, index + 1, weight_left - weight)
                if total_value + value + estimate1 > best_value:
                    stack.append((1, index + 1, weight_left - weight, total_value + value))
        else:
            if total_value > best_value:
                best = list(current)
                best_value = total_value

    is_optimal = True

    best = [(real_index, best[index]) for index, real_index in enumerate(sorting)]
    best.sort()
    best = [item[1] for item in best]

    #print 'Calculated in %s sec' % round(time() - start, 3)

    return '%s %s\n%s' % (best_value, 1 if is_optimal else 0, ' '.join(map(str, best)))


